description:
Verenigd Koninkrijk
Thriller
89 minuten

geregisseerd door Gareth Maxwell Roberts
met Method Man, Dash Mihok en E.J. Bonilla

Een vervreemde en koude begrafenisondernemer voelt zich bedreigd door zijn nieuwe medewerker Noah, die de beruchte gangster Carver mee het mortuarium inbrengt. De interesse van de begrafenisondernemer wordt gewekt als hij een tatoeage ontdekt bij het vermoorde meisje Jenny, maar hij wordt geterroriseerd met enge dromen uit zijn kindertijd. Wanneer het bange jongetje Kane in het mortuarium terecht komt, beginnen de problemen.


Vertaling : Tackler[b] Simply Releases Toppers[/b]

